using System;
using System.Collections;
using System.Collections.Generic;
using System.Text;

namespace Os95.Commands
{
    public abstract class Command
    {

        string         _id;
        CommandManager _manager;

        public string          GetID() => _id;
        public abstract string GetDesc();
        public abstract void   Execute(string[] args);

        protected CommandManager Manager => _manager;

        public Command(CommandManager manager, string id)
        {
            _id      = id;
            _manager = manager;
        }
    }

    public class CommandManager : IEnumerable<Command>
    {
        Dictionary<string, Command> commands = new Dictionary<string, Command>();

        public void Execute(string command)
        {
            var str = command.Split(' ');
            var id = str[0].ToUpper();

            if (commands.ContainsKey(id))
            {
                var args = new string[str.Length - 2];
                Array.Copy(str, 1, args, 0, args.Length);

                commands[id].Execute(args);
            }
            else
            {
                Console.WriteLine("Command " + id + " does not exist. Type HELP for more info");
            }
        }


        public  void Register<T>(string id) where T : Command
        {
            id = id.ToUpper();
            commands.Add(id, (T)Activator.CreateInstance(typeof(T), this, id));
        }

        public IEnumerator<Command> GetEnumerator()
        {
            return commands.Values.GetEnumerator();
        }


        IEnumerator IEnumerable.GetEnumerator()
        {
            return GetEnumerator();
        }
    }
}
```

