**Version**: [SDK 5.0.101](https://dotnet.microsoft.com/download/dotnet/5.0)

### Describe the bug

![image](https://user-images.githubusercontent.com/18743295/103448697-87643580-4c9d-11eb-80da-05986a4d000f.png)

The inlined code should be "new Closure(args).Run" and not "new(args).Run".

### Steps To Reproduce

```csharp
class MyClass
{
    void Test()
    {
        MyClass myClass = new();
        myClass.ToString();
    }
}
```

### Expected behavior

```csharp
class MyClass
{
    void Test()
    {
        new MyClass().ToString();
    }
}
```

### Actual behavior
```csharp
class MyClass
{
    void Test()
    {
        MyClass myClass = new();
            (new()).ToString();
    }
}
```

