The culprit seems to be the ungrouped `\mkrelatedstring` call when
printing the bibstring inside a `\setunit`. The call expands to
`\mainlang`, which expands to babel's `\setlanguage`, and
`\MakeSentenceCase*` seems to be in a linguistic limbo after that, even
though American should be the language both before and after the
`\setlanguage` call. If I group the `\bibstring` call with an extra set of
braces in the `related:bytranslator` macro it works fine, like so:

`\setunit*{\addspace{\bibstring[\mkrelatedstring]{astitle}}\space}%`

Using an `otherlanguage` environment inside the `\setunit` also works. If
the related entry's `langid` field is explicitly set to `american`, it
works, too.

