### 🙁 Actual behavior

When you have a custom type (local `*.d.ts` file with module declaration with a type in it) and want to use it in a file that is excluded by the tsconfig (test file or a script file that is called using ts-node) - typescript will not be able to find said type and either highlight the import with error `Cannot find module 'custom/module' or its corresponding type declarations.` or throw an error, depending on the specific case (test or script usage).

I have tried various settings like `paths` and `typeRoots` of tsconfig, including `--files` option of ts-node and was not able to find a proper solution, only workarounds. (in form of secondary tsconfig file or in form of `--transpile-only` option for ts-node) And having 2 different workarounds for the same issue is kind of sad :(

### 🙂 Expected behavior

Typescript should be able to pick up custom types for files which are excluded from ts-config via `exclude` property. (or have an option to do so.)

Would also appreciate any alternative solutions to make sure that custom types are recognized in excluded files. Maybe there is an easy alternative to restructure the code to be able to use custom types. Or perhaps some typescript option that I have missed or misused.

I would prefer to avoid including tests and scripts in tsconfig, because that will mean that output `dist` folder will have to be cleaned up and restructured each time after the build script has ran.

